						<div itemprop="articleBody">
		<p style="text-align: left;">Første meddelelse om den</p>
<p style="text-align: center;"><strong>29. internationale kongres i</strong></p>
<p style="text-align: center;"><strong>Medical Women International Association (MWIA) i Seoul, Korea.</strong></p>
<p style="text-align: center;"><strong>31. july - 3. august 2013</strong></p>
<p style="text-align: left;">Det overordnede tema er</p>
<p style="text-align: center;"><strong>Medical Women Advance Global Health</strong></p>
<p style="text-align: left;">med følgende underordnede temaer:</p>
<p style="text-align: center;"><strong> Underpriviliged Women and Children</strong></p>
<p style="text-align: center;"><strong>Enviromental Disasters </strong></p>
<p style="text-align: center;"><strong>Aging Society and Women </strong></p>
<p>Yderligere oplysninger kan ses på hjemmesiden: <a href="http://www.mwiaseoul2013.org">http://www.mwiaseoul2013.org</a></p>
<p>Der er allerede nu mulighed for registrering online.</p>
<p>I KLFs bestyrelse vil vi gerne opfordre et af vore yngre medlemmer til at deltage med et ”paper”. Bliver det accepteret, er det muligt at få tilskud til kongressen fra foreningen.</p>
<p>Det kan varmt anbefales at deltage i denne kongres. Emnerne er yderst relevante og aktuelle og Korea er et meget spændende land at besøge.</p>
<p>Agnete Basbøll</p>	</div>

	
